import React, { useState } from 'react';
import './comp2.css';

const Component2 = (props) => {
  const { changeId } = props;
  const [state, setState] = useState({
    organization_name: ''
  });

  const prevComponent = () => {
    changeId(1);
  };

  const handleSubmit = () => {
    if (state.organization_name.trim() !== '') {
      changeId(3);
    }
    props.onSubmit({ organization_name: state.organization_name });
  };
  const handleOrganizationChange = (e) => {
    const { value } = e.target;
    setState((prevState) => ({
      ...prevState,
      organization_name: value
    }));
  };

  return (
    <div className="component2">
      <h2>Enter Your Organization Details</h2>
      <br />
      <h3>Organization Name</h3>
      <input
        className="input-box"
        value={state.organization_name}
        onChange={handleOrganizationChange}
      />

      <button className="prev-button" onClick={prevComponent}>
        Previous
      </button>
      <button className="save-button" onClick={handleSubmit} disabled={!state.organization_name.trim()}>
        Save and Proceed
      </button>
    </div>
  );
};

export default Component2;
